import React from "react";
import { Text, View } from "react-native";

function EventsDetail({ route }) {
  const { eventID, eventName } = route.params;
  return (
    <View>
      <Text>Event ID: {JSON.stringify(eventID)}</Text>
      <Text>Event Name: {JSON.stringify(eventName)}</Text>
    </View>
  );
}

export default EventsDetail;
